import React from "react";
import Header from "./components/Header/Header";
import Hero from "./components/Hero/Hero";
import Slider from "./components/Slider/Slider";
import "./App.css";

function App() {
  return (
    <div className="app">
      <Header />
      <Hero />
      <Slider />
    </div>
  );
}

export default App;
